function containFunction(){
var var6, part;
var6=F.ORGANIZATION_NAME.read();
mlov=F.ORGANIZATION_LOCATION_LOV.readLov();
part=F.ORGANIZATION_NAME .partOf("Te");
partIgnore=F.ORGANIZATION_NAME .partOfIgnoreCase("Ve,ER,fY")

if (var6.length==1){
F.ORGANIZATION_LOCATION_LOV.callInfolet(F.ORGANIZATION_HISTORY_TEXTAREA.writeLov(mlov));             //callInfolet() API called
}
if (var6.length==4){
if(F.ORGANIZATION_NAME.contains("Test"))                                                          //contains() API called
Ext.Msg.alert('alert',"The text in ORGANIZATION_NAME field contains 'Test'.");
else
Ext.Msg.alert('alert',"The text in ORGANIZATION_NAME field does not contain 'Test'.");
}
if (var6.length==5){
F.LEVEL2_APPROVER.write(part);                                                                          //partOf() API called. Not working, as expected. Even if the text is part of entered text, it returns false.
}
if (var6.length==6){
if(F.ORGANIZATION_NAME.containsIgnoreCase("Verify"))                                     //containsIgnoreCase() API called
Ext.Msg.alert('alert',"The text in ORGANIZATION_NAME field contains 'Verify'.");
else
Ext.Msg.alert('alert',"The text in ORGANIZATION_NAME field does not contain 'Verify'.");
}
if (var6.length==7){
F.LEVEL3_APPROVER.write(partIgnore);       //partOfIgnoreCase() API called. Not working, as expected. Even if the text is part of entered text, it returns false.
}
if (var6.length==12)
{ 
if(F.ORGANIZATION_NAME.isEmail())                              //isEmail() API called
Ext.Msg.alert('alert',"The contents of field match standard email pattern.");
else
Ext.Msg.alert('alert',"The contents of field does not match any standard email pattern. Please confirm");
}
}

