car_disp=F.EMPLOYEE_DESIGNATION_DROPDOWN.readDisplayedValue(1);                     //readDisplayedValue() API called
car_stor=F.EMPLOYEE_DESIGNATION_DROPDOWN.readStoredValue(1);                        //readStoredValue() API called
car_lov=F.EMPLOYEE_LOCATION_LOV.readDisplayedValue(1);                                       //readLov() API called deprecated. Used readDisplayedValue instead of it, as mentioned in Help document
car_val=F.EMPLOYEE_LOCATION_LOV.readValue(1);                                                   //readValue() API called

if (dum1.length==1){
Ext.Msg.alert('alert',"readDisplayedValue() API called. The displayed value of the EMPLOYEE_DESIGNATION_DROPDOWN is : "+car_disp);            //readDisplayedValue() API called.
F.EMPLOYEE_NAME.write(car_stor,1);                                                                                                    //write() API called.
F.EMPLOYEE_ADDRESS_RTF.write(car_lov,1);     
F.EMPLOYEE_HISTORY_TEXTAREA.writeValue(car_val,1);                                                                   //writeVal() API called                                                                                                             
}
if (dum1.length==2){
var boolean1=F.EMPLOYEE_NAME.isRequired();                                                                                    //isRequired() called
if(boolean1=="true"){
Ext.Msg.alert('alert',"EMPLOYEE_NAME field is mandatory. The returned value for isRequired() function is : "+boolean1); 
}
else{
Ext.Msg.alert('alert',"EMPLOYEE_NAME field is not mandatory. The returned value for isRequired() function is : "+boolean1); 
}
}
if (dum1.length==3){
Ext.Msg.alert('alert',"Employee Names are : "+F.EMPLOYEE_NAME.readAll(" ; "));                         //readAll() called
var ename=F.EMPLOYEE_NAME.readAll(" ; ");
F.EMPLOYEE_ADDRESS_RTF.writeAll(ename," ; ");                                                                         //writeAll() called
F.EMPLOYEE_HISTORY_TEXTAREA.writeAll("D_1000;D_1001;D_1002",";");
}
if (dum1.length==4){
var testVal = F.EMPLOYEE_LOCATION_LOV.read();
var testArr = testVal.split(F.EMPLOYEE_LOCATION_LOV.getMultiLOVDelimiter());             //getMultiLOVDelimiter() API works for LOV, but not for MLOV
//var testArr = testVal.split(F.BIRTH_PLACE.getMultiLOVDelimiter()); 
for(j=0;j<testArr.length;j++) 
Ext.Msg.alert('alert',"You selected the following employee locations : " +testArr[j]); 
}
}
